import logo from './logo.svg';
import './App.css';
import AddContact from './Components/AddContact';
import ContactList from './Components/ContactList';
import NavBar from './Components/NavBar';

function App() {
  return (
    <div className="App">
      <NavBar/>
     <AddContact/>
     <ContactList/>
    </div>
  );
}

export default App;
